export var TableSelectionMode;
(function (TableSelectionMode) {
    /**
     * The rows are not selectable.
     */
    TableSelectionMode["None"] = "None";
    /**
     * Only a single row is selectable. Clicking on another row will unselect the previously selected row.
     */
    TableSelectionMode["SingleSelect"] = "SingleSelect";
    /**
     * Multiple rows are selectable.
     */
    TableSelectionMode["MultiSelect"] = "MultiSelect";
})(TableSelectionMode || (TableSelectionMode = {}));
